import React from 'react';
import '../styles/textarea.css';

const e = React.createElement;

function Console(props){

        console.log(props);
        const value = (props) => {
            props.console.map(value=>{
                return value;
            });
        }


       return e('textarea',{
           className:'console',
           value:value(props)
       },)


}

export default Console;
